pragma solidity >=0.4.21 <0.7.0;

contract TicketData {
    address private _admin;
    event TicketTrace(string cTicketId, address indexed holder, uint256 price, string state, string indexed indexcTicketId);

    constructor() public
    {
        _admin = tx.origin;
    }
    
    function _TicketTrace(string cTicketId, address holder, uint256 price, string state) public {
        emit TicketTrace(cTicketId, holder, price, state, cTicketId);
    }
}
